import React from 'react';
import './HomePage.css';


function HomePage() {
  return (
    <div className="container">
    <div className="heading">
      <h1>WPASKJBDN ZQNAKJSNDE</h1>
    </div>
    <div className="content">
      <p>
        The tiger is the largest cat species, most recognizable for their pattern of dark vertical stripes on reddish-orange fur with a lighter underside. They are apex predators, primarily preying on ungulates such as deer and bovids. They are territorial and generally solitary but social animals, often requiring large contiguous areas of habitat that support their prey requirements.
      </p>
      <p>
        The tiger is an iconic symbol of strength and bravery, and has played a pivotal role in many cultures throughout history. Unfortunately, their populations have declined significantly in recent years due to habitat loss, poaching, and other human-related factors. As such, many conservation efforts are underway to protect and preserve these magnificent animals for future generations.
      </p>
      <p>
        There are currently six subspecies of tiger, each with unique characteristics and ranges. These include the Bengal, Indochinese, Malayan, Siberian, South China, and Sumatran tigers. While all subspecies are endangered, the South China tiger is considered to be critically endangered, with only a handful left in the wild.
      </p>
      <p>
        In conclusion, the tiger is a majestic and awe-inspiring animal that has captured the hearts and imaginations of people around the world for centuries. It is important that we take action to protect and conserve these amazing creatures, so that future generations can continue to marvel at their beauty and power.
      </p>
    </div>
  </div>
  );
}


export default HomePage;
